import { PieChart, Pie } from "recharts";

const data = [
  { name: "Jan", val: 400 },
  { name: "Feb", val: 300 },
  { name: "Mar", val: 200 },
  { name: "Apr", val: 300 },
  { name: "May", val: 400 },
  { name: "Jun", val: 500 },
];

const renderSpent = (
  <PieChart width={400} height={400} data={data}>
    <Pie
      dataKey="val"
      cx={500}
      cy={200}
      innerRadius={40}
      outerRadius={80}
      fill="#82ca9d"
    />
  </PieChart>
);

export default renderSpent;
